import React from 'react';
import FileItem from './FileItem';

function FileManager() {
  const files = [
    { name: 'file-manager-screenshots', type: 'folder' },
    { name: 'hello', type: 'folder' },
    { name: 'test folder upload', type: 'folder' },
    { name: 'Pong.webm', type: 'video/webm', size: '1.11 MB', modified: '2020/11/22 23:01:40' },
    { name: 'some_files.zip', type: 'application/zip', size: '10 MB', modified: '2020/11/23 19:32:19' }
  ];

  return (
    <div className="file-manager">
      <div className="file-manager-header">
        <button className="btn">Refresh</button>
        <button className="btn">Ignore Folder Structure</button>
        <button className="btn">Grid View</button>
      </div>
      <div className="file-list">
        {files.map((file, index) => (
          <FileItem key={index} file={file} />
        ))}
      </div>
    </div>
  );
}

export default FileManager;
